	// Bitbase indexing scheme is copied from SF
	// bit 0- 5: white king square, bit 6-11: black king square, bit 12: side to move, bit 13-14: white pawn file, 
	// bit 15-17: white pawn rank (distance to 7th rank, so pawn for pawn on A6 rank is 1)
	uint32_t index(Square BlackKingSquare, Square WhiteKingSquare, Square WhitePawnSquare, Color stm) {
		return WhiteKingSquare | (BlackKingSquare << 6) | (stm << 12) | ((WhitePawnSquare & 7) << 13) | ((Rank7 - (WhitePawnSquare >> 3)) << 15);
	}


	bool probe(Square WhiteKingSquare, Square WhitePawnSquare, Square BlackKingSquare, Color stm) {
		uint32_t idx = index(BlackKingSquare, WhiteKingSquare, WhitePawnSquare, stm);
		return (Bitbase[idx / 32] & (1 << (idx & 0x1F))) != 0;
	}

